export default function Jumbotron(props) {
    return (
    <div className="container-fluid bg-primary">
        <div className="row">
            <div className="col text-center p-5 bg-light">
                <h1>props.</h1>
                <p className="lead">Page Subtitle</p>
            </div>
        </div>
    </div>
    );
}
